ewerbsbeh\xF6rde ein. Als erste Stadt habe St. Gallen einzelne Klauseln ihres Kooperationsvertrages im Rahmen eines Widerspruchsverfahrens zur \xDCberpr\xFCfung gemeldet, weshalb diese Kooperation auch als erste beurteilt werde. Bei diesen Vertragsklauseln sehe die Weko teilweise 'wettbewerbsrechtliche Probleme', weshalb sie jetzt eine Vorabkl\xE4rung er\xF6ffnet habe. Die ausgehandelten Vertragsklauseln, so die Weko, 'k\xF6nnten gem\xE4\xDF einer ersten Einsch\xE4tzung den Wettbewerb nachhaltig beschr\xE4nken und langfristig zu einer Monopolisierung der Glasfasernetzinfrastruktur f\xFChren'. Ins Visier nehmen die Wettbewerbsh\xFCter auch die geplante Gr\xFCndung eines Gemeinschaftsunternehmens zwischen der Swisscom und dem Energieversorger Groupe E zum Aufbau und Betrieb einer gemeinsamen Glasfaserinfrastruktur im Kanton Freiburg. Hier best\xFCnden Anhaltspunkte, dass das Gemeinschaftsunternehmen 'eine marktbeherrschende Stellung begr\xFCndet oder verst\xE4rkt'. (pmz) ",_vc='Dimension',$hc='Dimension [height=',psc='DirectionalTextHelper',ssc='DockLayoutPanel',tsc='DockLayoutPanel$Direction',usc='DockLayoutPanel$Direction;',xsc='DockLayoutPanel$DockAnimateCommand',vsc='DockLayoutPanel$LayoutData',Coc='DomEvent',Hoc='DomEvent$Type',Juc='Double',Yec='EAST',T9b='EEE, d MMM yyyy HH:mm:ss Z',Pkc='EEE. dd MMM. yyyy HH:mm:ss',lac='EEEE, MMMM d',W9b='EEEE, MMMM d, y',u7b='EM',bdc='EMPTY',gdc='ENABLED',ybc='END',w7b='EX',Xqc='ElementMapperImpl',Yqc='ElementMapperImpl$FreeNode',nbc='English',Onc='Enum',ebc='Etc/GMT',gbc='Etc/GMT+',fbc='Etc/GMT-',O7b='Event type',Ptc='Event$NativePreviewEvent',Uoc='EventBus',cnc='EventObject',hnc='Exception',Fdc='Expecting version 6 from server, got ',K8b='F',Yic='F8834F07517EF3B7D02B9E845E5E1B88',p7b='FIXED',bec='FLOAT',Gic='Fail: ',c9b='Feb',S8b='February',Kuc='Float',ysc='FlowPanel',Zrc='FocusWidget',ahc='For input string: "',G9b='Fri',z9b='Friday',a8b='GET',elc='GGD55XLBAH',Lmc='GGD55XLBAK',dmc='GGD55XLBBI',qkc='GGD55XLBBJ',dlc='GGD55XLBCH
